import style from "../StudentDashboard.module.css";
import { useState, useEffect } from "react";
import axios from "axios";
import { NavLink } from "react-router-dom";
import baseUrl from "../../../baseUrl";

function Subject() {
  const [allSubject, setAllSubject] = useState([]);

  useEffect(() => {
    async function getAllSubject() {
      let value = await axios.get(`${baseUrl}/subject`);
      setAllSubject(value.data);
    }
    getAllSubject();
  }, []);

  return (
    <>
      <div className="container">
        <div className={`text-center ${style.displayBoxHeadingBox}`}>
          <h1>Choose Subjects</h1>
        </div>

        <div className="row justify-content-center">
          {allSubject.map((data, i) => {
            return (
              <div className={`col-md-6 ${style.displayBoxSubjectBox}`} key={i}>
                <div className={style.subjectText}>
                  <span>{data.name}</span>
                </div>

                <div className={style.subjectButton}>
                  <NavLink exact to={`/StudentDashboard/Exam/${data.name}`}>
                    <button className="btn btn-primary">Go to Exam</button>
                  </NavLink>
                </div>
              </div>
            );
          })}
        </div>
      </div>
    </>
  );
}

export default Subject;
